import * as React from "react";
import * as data from "./data";

export interface GamepadFocusBadgeProps {
    visible: boolean;
    marginFix: string;
    zIndex: number;
    opacity: number;
}

export class GamepadFocusBadge extends data.PureComponent<GamepadFocusBadgeProps, {}> {
    renderCore() {
        return (
            <img
                src="data:image/png;base64,"
                className={`gamepad-focus-badge${(this.props.visible) ? "" : " hidden"}`}
                style={{
                    width: "40px",
                    height: "40px",
                    position: "absolute",
                    zIndex: this.props.zIndex,
                    //opacity: 0.7,
                    pointerEvents: "none",
                    objectFit: "contain",
                    margin: this.props.marginFix,
                    opacity: this.props.opacity
                }}
            />);
    }
}
